// building_info/buildingCollection.js
const buildingCollection = {
  "type": "FeatureCollection",
  "features": [
    {
      "type": "Feature",
      "properties": {},
      "geometry": {
        "type": "Polygon",
        "coordinates": [
          [
            [126.931915, 37.575739],
            [126.931915, 37.593152],
            [126.95612, 37.593152],
            [126.95612, 37.575739],
            [126.931915, 37.575739],
          ]
        ]
      }
    }
    // 이전에 추가된 폴리곤들...
  ]
};

export default buildingCollection;
